import styled from "styled-components";

const Logo = styled.h3`
  color: blue;
`;

const HeaderWrapper = styled.header`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 72px;
  text-align: center;
`;

const Header = () => {
  return (
    <HeaderWrapper>
      <Logo>tom wise</Logo>
    </HeaderWrapper>
  );
};

export default Header;
